import React from "react";
import ReactDOM from "react-dom";
import './index.css'

var name = "Maninder";
var id = "1972011";

const main = {
  color: 'blue',
  marginRight: '50px',
  fontSize:'5rem',
}

ReactDOM.render(
  <>
    <h3 className="head">{ `My Name is ${ name } ${ id } Yo` }</h3>
    <h4>Addition is { 4%2 }</h4>
    <p id="c" style="{main}" contentEditable="true">HI HI HI</p>
    <a href="https://www.google.com">Check</a>
  </>,
  document.getElementById("root")
);
